def html_to_markdown_list():
    soup = BeautifulSoup(html, "html.parser")
    markdown_list = []

    # Find all li elements
    for i, li in enumerate(soup.find_all("li"), 1):
        # Get the anchor tag
        a_tag = li.find("a")
        if a_tag:
            # Get the text and href
            text = a_tag.text.strip()
            href = a_tag.get("href")
            # Create markdown link format
            markdown_list.append(f"{i}. [{text}]({href})")

    # Join all items with newlines
    return "\n".join(markdown_list)


if __name__ == "__main__":
    print(html_to_markdown_list())
